  return (
    <>
      <div className="wrapper">
        <SearchContext.Provider value={{ searchValue, setSearchValue }}>
          <Header />
          <div className="content">
            <Outlet></Outlet>
          </div>
        </SearchContext.Provider>
      </div>
    </>
  );
}

export default App;
